pragma solidity ^0.8.0;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor () {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

interface BusinessCardContractInterface {
    function callback(uint256 _tokenId, string memory _tokenURI, uint256 _id) external;
}

contract BatesOracle is Ownable {

	uint private randNonce = 0;
	uint private modulus = 1000000000;
	// Each new request gets a unique id, and starts as pending -> true
	mapping (uint256 => bool) pendingRequests;

	// Events that will get triggered, and caught by the oracle server
	event UpdateTokenURIEvent(address callerAddress, uint256 tokenId, string name, string position, uint256 genes, uint id);
	event SetTokenURIEvent(address callerAddress, uint256 tokenId, string tokenURI, uint256 id);

	
    /**
     * @dev Call to update a tokenURI - gets picked up and processed by the server oracle, updating it via setTokenURI
    */
    function updateTokenURI(uint256 tokenId, string memory name, string memory position, uint256 genes) public returns(uint256) {
		// Generating a unique request id 
        randNonce++;
        uint id = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, randNonce))) % modulus;
	   // Once generated, it is a pending request
       pendingRequests[id] = true;
       // Event to get picked up by the server side of the oracle
       emit UpdateTokenURIEvent(msg.sender, tokenId, name, position, genes, id);
       return id;
    }

    /**
     * @dev Sets a tokenURI calling the Business Card contract
    */
    function setTokenURI(uint256 tokenId, string memory tokenURI, address callerAddress, uint256 id) public onlyOwner {
        require(pendingRequests[id], "Request is not in the pending list");
        delete pendingRequests[id];
        // ADD THIS INTERFACE
        BusinessCardContractInterface businessCardContractInstance;
        businessCardContractInstance = BusinessCardContractInterface(callerAddress);
        businessCardContractInstance.callback(tokenId, tokenURI, id);
        emit SetTokenURIEvent(callerAddress, tokenId, tokenURI, id);
    }

    /**
     * @dev Withdraw BNB from this contract (Callable by owner)
    */
    function withdraw() onlyOwner public {
        uint balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }
}
